Aggregate subdocuments, filter them by a list of ids, and group values by id<p>I have a list of mongo ObjectIds that I need to map over, assign some responses (which may or may not exist) to that id, then generate an availability average based upon the responses. For example, I have a list of ObjectIds which refer to <code>Users</code>:</p>

<pre><code>["5d978d372f263f41cc624727", "5d978d372f263f41cc624728", "5d978d372f263f41cc624729"]
</code></pre>

<p>And an aggregated list of <code>Events</code> which contain an <code>employeeResponses</code> subdocument that, if they've responded, records their <code>_id</code> , <code>response</code>, and any event <code>notes</code>:</p>

<pre><code>[
  {
    ...
    employeeResponses: [
      {
        _id: "5d978d372f263f41cc624727",
        response: "I want to work.",
        notes: ""
      },
      {
        _id: "5d978d372f263f41cc624728",
        response: "Available to work.",
        notes: ""
      }
    ]
  },
  {
    ...
    employeeResponses: [
      {
        _id: "5d978d372f263f41cc624727",
        response: "I want to work.",
        notes: ""
      },
      {
        _id: "5d978d372f263f41cc624728",
        response: "Prefer not to work.",
        notes: ""
      }
    ]
  },
  {
    ...
    employeeResponses: [
      {
        _id: "5d978d372f263f41cc624727",
        response: "Not available to work.",
        notes: ""
      },
      {
        _id: "5d978d372f263f41cc624729",
        response: "Not available to work.",
        notes: ""
      },
    ]
  }
]
</code></pre>

<p>What I need to do is assign their response (or lack of response) to their id in a <code>responses</code> array:</p>

<pre><code>[
  {
    "_id": "5d978d372f263f41cc624727",
    "responses": ["I want to work.", "I want to work.", "Not available to work."]
  },
  {
    "_id": "5d978d372f263f41cc624728",
    "responses": ["Available to work.", "Prefer not to work.", "No response."] 
  }
  {
    "_id": "5d978d372f263f41cc624729",
    "responses": ["No response.", "No response.", "Not available to work."] 
  }
]
</code></pre>

<p>Then, based upon their response, generate a member availability average (<strong>available</strong>: <code>["I want to work.", "Available to work"]</code>; <strong>unavailable</strong>: <code>["Prefer not to work.", "Not available to work.", "No response."]</code>):</p>

<pre><code>[
  {
    "_id": "5d978d372f263f41cc624727",
    "availability": 66
  },
  {
    "_id": "5d978d372f263f41cc624728",
     "availability": 33,
  }
  {
    "_id": "5d978d372f263f41cc624729",
     "availability": 0,  
  }
]
</code></pre>

<p>With the help of @mickl, I can <a href="https://stackoverflow.com/a/58314591/7376526">aggregate the responses for 1 ObjectId</a>, but I'm struggling to expand it to a list of ObjectIds without mapping over the ids and aggregating per user -- which seems very inefficient and costly.</p>

