Mongo client API with resource token<p>I have been trying to use a Mongo API cosmos account with multiple databases and wanted to generate resource token for the individual resources. I am seeing the implementation for Document DB like below.</p>

<pre><code>client = new DocumentClient(new Uri(endpointUrl), resourceToken);
</code></pre>

<p>However, I am looking for implementation related to Mongo.Driver</p>

<pre><code>MongoClientSettings settings = new MongoClientSettings();
        settings.Server = new MongoServerAddress(host, 10255);
        settings.UseSsl = true;
        settings.SslSettings = new SslSettings();
        settings.SslSettings.EnabledSslProtocols = SslProtocols.Tls12;

        MongoIdentity identity = new MongoInternalIdentity(dbName, userName);
        MongoIdentityEvidence evidence = new PasswordEvidence(tokepass2);

        settings.Credential = new MongoCredential("SCRAM-SHA-1", identity, evidence);

        MongoClient client = new MongoClient(settings);
</code></pre>

<p>I am trying to replace the "tokepass2" with the resource token that is generated. But that is not working and ended up with the exception </p>

<pre><code>One or more errors occurred. (Unable to authenticate using sasl protocol mechanism SCRAM-SHA-1.)
</code></pre>

<p>I know we have the possibility where we can do a REST based post call with the token in the header, however I am looking for an implementation related to Mongo Client, if some one has implemented.</p>

