Mongoose Slice Not Limiting Array Size<p>I'm working on an application and am having an issue with Mongoose limiting array size on update. I'm not too familiar with MongoDB or Mongoose but I'm hoping this project will grow my knowledge. I tried a few other solutions I queried on SOF but none appeared to work for me. Here is my breakdown of the problem...</p>

<p><strong>Library</strong>: Mongoose 5.7.7</p>

<p><strong>Summary</strong>: In a document of logs, I wish to keep only the 10 latest logs with the older being pushed off the array. </p>

<p><strong>Issue</strong>: With the current query I have, the slice appears not to be limiting the number of documents. The array just continues to grow. </p>

<pre><code>ActivityLog.updateOne(
  { guild },
  {
    $push: {
      logs: {
        $each: [{ ...log }]
      },
      $slice: -10
    }
  },
  { upsert: true }
);
</code></pre>

