Data modelling using mongoose for sports bet tracking application<p>I built a simple sports bet tracker application while I am learning the MERN stack. Users can track their sports bets and see various stats on their performance. It currently only supports tracking single bets (1 selection in bet) and I wish to add to ability to track multiple bets (>1 selections in bet). Each selection in a multiple bet will have the same data as a single bet <code>eventDate</code>, <code>sport</code>, <code>event</code>, <code>selection</code> <code>odds</code> etc. I'm just looking for some advice on the best way to add this in. Bet model currently is as follows</p>

<pre><code>const betSchema = mongoose.Schema({
  eventDate: {
    type: Date
  },
  sport: {
    type: String
  },
  event: {
    type: String
  },
  market: {
    type: String
  },
  selection: {
    type: String
  },
  odds: {
    type: Number
  },
  result: {
    type: String,
    default: 'Pending'
  },
  stake: {
    type: Number
  },
  owner: {
    type: mongoose.Schema.Types.ObjectId,
    required: true,
    ref: 'User'
  }
}, {
  timestamps: true
})
</code></pre>

<p>Going forward a bet can have one selection or many in it so I was thinking this should become an array. If it has one selection the odds for the bet will be the odds of that selection but if it has multiple selections in it the odds of the bet will be the odds of the selections multiplied. If one selection in a multiple bet loses the bet is a loss. I was thinking something like the following setup but I'm not sure as I don't have much database experience any help who'd be appreciated.</p>

<pre><code>const betSchema = mongoose.Schema({
  selections: [{
    sport: {
      type: String
    },
    event: {
      type: String
    },
    eventDate: {
