MongoDB upsert creates another instance<p>I currently have an upsert function in my project which works but my main problem is that it creates another instance of the record, and updates the new instance instead. This is the code:</p>

<pre><code>router.route('/carousel/update/:_id').put(function(req, res) {

 var id;
 if(req.params._id  == 'undefined'){

    id = crypto.randomBytes(12).toString('hex');
 } 

 else {
    id = ObjectId(req.params._id)
 }

 db.collection('home').updateOne({"_id": id},
     {$set: req.body}, {upsert: true}, (err, results) =&gt; {
         if (err) throw err;
         res.send(results)

         console.log(req.body)
 });
});

</code></pre>

<p><strong>The problem:</strong> </p>

<p><strong>1.</strong> It mystifies me that mongoDB takes my crypto generated _id and takes it as the new _id for the upserted document. Why is that? When <code>{upsert: true}</code>, isn't mongoDB supposed to generate a new _id?</p>

<p><strong>2.</strong> Because of the nature of problem 1, whenever I try to update the original document, it updates the upserted document instead since they have the same _id values even though their <code>_id</code>s are positioned at different document levels.</p>

<p>In conclusion, when given a <code>'home'</code> document, how do I upsert correctly without adding a new record with the same values and _ids? </p>

<p>Thanks for your help!</p>

<p>EDIT </p>

<p>This is the JSON body content of the document with custom generated _id using crypto:</p>

<pre><code>{
    "_id": "1262d480eea83567181b3206",
    "header": "hello",
    "subheader": "hello"
}
</code></pre>

<p>Whereas, this is the body content of the upserted document.</p>

<pre><code>{
    "_id": {
        "$oid": "1262d480eea83567181b3206"
    },
    "header": "helloasad",
    "subheader": "helloasda"
}
</code></pre>

<p>As observed, after upserting, it takes the same _id value of the original document but on another document level.</p>

