NodeJs - Mongoose query in API failing in Mocha Chai test only<p>I am new to unit testing in Mocha/Chai and stuck on this issue. I have an POST for registering a new user. In that post, I check to see if the user is already in the database. </p>

<pre><code>if(error) return res.status(400).send(error.details[0].message);
console.log('check this ' +  req.body.email);
//console.log(`Connected to ${db}...`)
console.log(`Connected to ${User.db.mongoose}...`)
let user = await User.findOne({ email: req.body.email});
console.log(user);
if(user) return res.status(400).send('User already registered');
</code></pre>

<p>What I discovered the first test will register the user (inserting the information in the DB). What I found is that the second test fails.</p>

<pre><code>it('Should reject duplicate new user', async() =&gt; {
        const res = await request(server)
            .post('/api/users/')
            .send({firstname: sFirstName, lastname: sLastName, email: sEmail, password: sPassword});

        expect(res.status).to.be.equal(400);
        expect(res.error).to.be.equal('User already registered');

    });
</code></pre>

<p>The reason for the failure is that the connection string that the Query fails, thus not returning any records. So, I tested the query in Postman and the POST API is working as expected. I am curious if anyone knows why the mongoose query will not work when I run the test in Mocha but work when I connect via postman. Any thoughts would be appreciated. </p>

<pre><code>const {User, validate} = require('../models/user');


module.exports = function() {
    //Database connection 
    const db = config.get('db');
    mongoose.connect(db,{ useNewUrlParser: true })
        .then(() =&gt; console.log(`Connected to ${db}...`))
        .catch(err =&gt; console.error(`Could not connect to ${db}...`, err));
</code></pre>

<p>}</p>

