<p>I have an object named <code>Instance</code> that I retrieve from the Mongo collection just fine. However, the object's <code>Template</code> property belongs in a separate collection and is null when querying the Instance collection. I would like to eager load the template data when querying the instance.</p>

<p>This would be the equivalent of Entity Framework's <code>Include</code> method which eager loads related entities. I have searched the net for an equivalent approach using the C# Mongo driver but no luck.</p>

<p>How can I accomplish this using the C# MongoDb driver and Linq?</p>

<pre><code>public class Instance
{
    public int Id { get; set; }
    public string Name { get; set; }
    public int? TemplateId { get; set; }
    public Template Template { get; set; }
}
public class Template
{
    public int Id { get; set; }
    public string Name { get; set; }
}

var collection = MongoDatabase.GetCollection&lt;Instance&gt;("Instances").AsQueryable()
var instance = collection.First(i =&gt; i.Id == 1);
var template = instance.Template; //always null
</code></pre>

